import React from 'react';

import styled from "styled-components";
import { AiOutlineCamera } from 'react-icons/ai';
import { RxHamburgerMenu } from 'react-icons/rx';


const H = styled.div `
    text-align:left;
    width:100%;
    height:60px;
    background-color: #343a40;;
    font-size: 20;
    padding: 10px; /* 내부 여백 설정 */
    color: white;
    display: flex;
    align-items: center;
    justify-content: center;
    `
    // const Wrapper=styled.div`
    // text-align:left;
    // color: white;
    // `

    const Menubar =styled.button`
   
    background-color:transparent;
    position: center;
    float: right;
    //padding-left:1000px ;
    margin-left: 1000px;
    padding-top:10px;
    cursor: pointer;
`;


const Header = () => {
    return (
        <>
             

        <H>
        < RxHamburgerMenu color="white" size= "40" />
        <AiOutlineCamera color="white" size= "40"/><Menubar/>
            <h1>album</h1>
        </H>
        </>
    );
};

export default Header;
